import React from "react";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import TestList from "./containers/TestList";
import PartList from "./containers/PartList";
import Part from "./containers/Part";
import "./App.scss";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/ets2020/test:testNumber/part:partNumber">
          <Part />
        </Route>
        <Route path="/ets2020/test:testNumber">
          <PartList />
        </Route>
        <Route path="/">
          <TestList />
        </Route>
      </Switch>
    </Router >
  );
};

export default App;
